import React, { Component } from 'react';
import axios from 'axios';

class Trees extends Component {

  componentDidMount() {
    axios.get("https://data.calgary.ca/resource/tfs4-3wwa.json")
      .then(response => {
        const data = response.data.results;
        this.setState({ data })
      })
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    return (
      <div className='T'>
        Hello Trees
      </div>
    )
  }
}

